INSERT INTO `litemall_brand` VALUES (1001000,'MUJI制造商','严选精选了MUJI制造商和生产原料，\n用几乎零利润的价格，剔除品牌溢价，\n让用户享受原品牌的品质生活。','http://yanxuan.nosdn.127.net/1541445967645114dd75f6b0edc4762d.png',2,12.90,'2018-02-01 00:00:00',1,0),(1001002,'内野制造商','严选从世界各地挑选毛巾，最终选择了为日本内野代工的工厂，追求毛巾的柔软度与功能性。品质比肩商场几百元的毛巾。','http://yanxuan.nosdn.127.net/8ca3ce091504f8aa1fba3fdbb7a6e351.png',10,29.00,'2018-02-01 00:00:00',1,0),(1001003,'Adidas制造商','严选找到为Adidas等品牌制造商，\n选取优质原材料，与厂方一起设计，\n为你提供好的理想的运动装备。','http://yanxuan.nosdn.127.net/335334d0deaff6dc3376334822ab3a2f.png',30,49.00,'2018-02-01 00:00:00',1,0),(1001007,'优衣库制造商','严选找到日本知名服装UNIQLO的制造商，\n选取优质长绒棉和精梳工艺，\n与厂方一起设计，为你提供理想的棉袜。','http://yanxuan.nosdn.127.net/0d72832e37e7e3ea391b519abbbc95a3.png',12,29.00,'2018-02-01 00:00:00',1,0),(1001008,'膳魔师制造商','严选深入保温行业内部，\n找到德国膳魔师制造商的代工厂。\n同样的品质，却有更优的价格。','http://yanxuan.nosdn.127.net/5fd51e29b9459dae7df8040c8219f241.png',40,45.00,'2018-02-01 00:00:00',1,0),(1001010,'星巴克制造商','严选寻访全国保温杯制造企业，\n最终找到高端咖啡品牌星巴克的制造商，\n专注保温杯生产20年，品质与颜值兼备。','http://yanxuan.nosdn.127.net/5668bc50f2f2e551891044525710dc84.png',34,39.00,'2018-02-01 00:00:00',1,0),(1001012,'Wedgwood制造商','严选寻访英国皇室御用陶瓷Wedgwood制造商，\n制模到成品，历经25道工序、7次检验、3次烧制，\n你看不见的地方，我们也在坚持。','http://yanxuan.nosdn.127.net/68940e8e23f96dbeb3548d943d83d5e4.png',21,39.00,'2018-02-01 00:00:00',0,0),(1001013,'Royal Doulton制造商','严选深入英国最大骨瓷品牌Royal Doulton制造商， \n顶级英国瓷器的代名词，广受世界皇室喜爱。\n每件瓷器，都有自己的故事。','http://yanxuan.nosdn.127.net/0de643a02043fd9680b11e21c452adaa.png',47,24.90,'2018-02-01 00:00:00',0,0),(1001015,'日本KEYUCA制造商','KEYUCA是日本餐具及料理用具品牌，\n遵循极简原木风，高端餐具体验。\n严选的餐具正是来自这一品牌制造商。','http://yanxuan.nosdn.127.net/9b85b45f23da558be101dbcc273b1d6d.png',49,14.90,'2018-02-01 00:00:00',0,0),(1001016,'爱慕制造商','150家样品比对筛选，20家工厂深入走访，\n严选最终选定高端内衣爱慕制造商，\n20年品质保证，为你打造天然舒适的衣物。','http://yanxuan.nosdn.127.net/5104f84110eac111968c63c18ebd62c0.png',9,35.00,'2018-02-01 00:00:00',0,0),(1001020,'Ralph Lauren制造商','我们与Ralph Lauren Home的制造商成功接洽，掌握先进的生产设备，传承品牌工艺和工序。追求生活品质的你，值得拥有。','http://yanxuan.nosdn.127.net/9df78eb751eae2546bd3ee7e61c9b854.png',20,29.00,'2018-02-01 00:00:00',0,0),(1001037,'新秀丽制造商','严选为制作品质与颜值兼具的箱包，\n选定新秀丽、CK、Ricardo等品牌合作的制造商，\n拥有国内先进流水线20余条，实力保障品质。','http://yanxuan.nosdn.127.net/80dce660938931956ee9a3a2b111bd37.jpg',5,59.00,'2018-02-01 00:00:00',0,0),(1001038,'Coach制造商','严选为制作高品质高颜值皮具配件，\n由Coach、MK等品牌制造商生产，\n由严选360度全程监制，给你带来优质皮具。','http://yanxuan.nosdn.127.net/1b1cc16135fd8467d40983f75f644127.png',3,49.00,'2018-02-01 00:00:00',0,0),(1001039,'MK制造商','严选为制造高品质的皮具，\n选择Michael Kors品牌合作的制造工厂，\n18年专业皮具生产经验，手工至美，品质保证。','http://yanxuan.nosdn.127.net/fc9cd1309374f7707855de80522fb310.jpg',17,79.00,'2018-02-01 00:00:00',0,0),(1001045,'罗莱制造商','严选团队为打造吸湿透气柔软的蚕丝被，\n从蚕茧原材到温感性能，多次甄选测试\n选择罗莱制造商工厂，手工处理，优质舒适。','http://yanxuan.nosdn.127.net/14122a41a4985d23e1a172302ee818e9.png',45,699.00,'2018-02-01 00:00:00',0,0),(1003000,'Carters制造商','来自Carters大牌代工厂生产，\n严选纯天然材料，无荧光不添加，\nITS安心标志权威检测，安全护航。','http://yanxuan.nosdn.127.net/efe9131599ced0297213e6ec67eb2174.png',41,19.90,'2018-02-01 00:00:00',0,0),(1005001,'Goody制造商','严选深入美国百年发饰品牌Goody制造商，\n确保每把梳子做工精湛，养护头皮。\n戴安娜王妃的最爱，你也能拥有。','http://yanxuan.nosdn.127.net/7c918f37de108f3687d69b39daab34eb.png',48,39.00,'2018-02-01 00:00:00',0,0),(1006000,'范思哲制造商','严选找寻意大利奢侈品牌范思哲Versace的制造商，\n致力于为用户带来精致、优雅、时尚的皮包，\n传承独特美感，体验品质生活。','http://yanxuan.nosdn.127.net/c80ae035387495a61a4515906205efff.png',18,99.00,'2018-02-01 00:00:00',0,0),(1008000,'WPC制造商','严选寻找日本雨伞品牌W.P.C制造商，\n采用严谨工艺以及环保材料，\n沉淀15年行业经验，打造精致雨具。','http://yanxuan.nosdn.127.net/c4e97cc87186ce17f9316f3ba39e220c.png',22,59.00,'2018-02-01 00:00:00',0,0),(1010001,'竹宝堂制造商','严选走访河北、安徽等制刷基地，\n选定竹宝堂、丝芙兰等品牌的制造商，\n严格把关生产与质检，与您一同追求美的生活。','http://yanxuan.nosdn.127.net/61b0b7ae4f0163422009defbceaa41ad.jpg',39,29.00,'2018-02-01 00:00:00',0,0),(1010002,'资生堂制造商','发现美，成为美，是女性一生的追求。\n严选找寻资生堂代工厂，打造天然美妆产品，\n致力于带来更多美的体验和享受。','http://yanxuan.nosdn.127.net/5449236b80d1e678dedee2f626cd67c4.png',19,29.00,'2018-02-01 00:00:00',0,0),(1015000,'NITORI制造商','宠物是人类最温情的陪伴，\n严选找寻日本最大家居品牌NITORI制造商，\n每一个脚印，都是为了更好地关怀你的TA','http://yan